import React from "react";
import Header from "../../components/header";
import p1 from "./img/p1.jpeg";
import p2 from "./img/p2.jpeg";
import p3 from "./img/p3.jpeg";
import { Link } from "react-router-dom";
import "./work.css";

function Works() {
    return ( 
    <div className="home">
      <div>
          <Header />
      </div>
      <div className = "body">
      <div className="WorkTab"> 
        <div className="title"> Projects </div>
        <div className="description"> Click on the posters to learn more </div>
        </div> 
        <div className="grid-container">
            <div className="grid-item"> 
               <Link to="/project1">
               <figure>
                  <img src={p1} />
                  <figcaption>Caption goes here</figcaption>
                </figure>
                 </Link>  
            </div>
            <div className="grid-item"> 
               <Link to="/project2"><img src={p2} /> </Link>  
            </div>
            <div className="grid-item"> 
               <Link to="/project3"><img src={p3} /> </Link>  
            </div>

        </div>


      </div>
    </div>
    );
  }

  export default Works;
